import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reducers from './reducers';

const store = createStore(reducers);

const rootElement = document.getElementById('root');
ReactDOM.render(
  <Provider store={store}>
      <App />
  </Provider>,
   rootElement
);
